        this.hideChargeDept = true;
        this.isReviewForm = true;
        this.isEntryForm = false;
        this.errorinfo = false;
        this.fixedPhoneIdentifier = false;
        this.employeeSerial = '';
        this.service = '';
        this.hideSteps = false;
        this.isButtonVisible = true;
        this.isSpinnerVisible = false;
